import React, { Component } from "react";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser } from "../actions/authAutentications";
import { Container, Row, Col, Button } from "react-bootstrap";
import { Link } from "react-router-dom";

class IlMioProfilo extends Component {
  onLogoutClick = (e) => {
    e.preventDefault();
    this.props.logoutUser();
  };

  render() {
    const { user } = this.props.auth;
    return (
      <div className="dashboardAutista" style={{ backgroundColor: "#010101" }}>
        <Container
          style={{
            textAlign: "center",
          }}
        >
          <Row>
            <Col sm={12}>
              <h1>
                Benvenuto <b>{user.name}</b>, qui puoi modificare il tuo profilo
              </h1>
            </Col>
          </Row>
          <Row>
            <Col sm={4} className="colonnaAutista">
              <Link to="/GestioneCorsaAdmin">
                <Button variant="primary" size="lg" block className="bottone">
                  Gestione Corsa
                </Button>
              </Link>
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}

IlMioProfilo.propTypes = {
  logoutUser: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => ({
  auth: state.auth,
});

export default connect(mapStateToProps, { logoutUser })(IlMioProfilo);
